import React, { useState, useEffect } from "react";
import { fetchAllCVs } from "../services/api"; // Importer API-funksjonene
import Navbar from "../components/Navbar";
import InputField from "../components/InputField";

const CV = () => {
  const [cvs, setCvs] = useState([]);

  useEffect(() => {
    // Her kan du hente alle CV-er fra API-et og oppdatere state
    fetchAllCVs().then((data) => setCvs(data)); // Eksempel på hvordan du kan bruke API-et
  }, []);

  return (
    <div>
      <Navbar />
      <h1>Administrer CV-er</h1>
      <div>
        {cvs.length > 0 ? (
          <ul>
            {cvs.map((cv, index) => (
              <li key={index}>{cv.name}</li> // Endre dette til hvordan du ønsker å vise dataene
            ))}
          </ul>
        ) : (
          <p>Ingen CV-er funnet.</p>
        )}
      </div>
    </div>
  );
};

export default ManageCVs;
